function ExpenseItem() {
    const expenses = {
        title: 'Car Insurance', amount: 294.67, date: new Date(2021, 2, 28),
        title: 'Car Insurance', amount: 294.67, date: new Date(2021, 2, 28),
        title: 'Car Insurance', amount: 294.67, date: new Date(2021, 2, 28),
    };
    return expenses;
}

export default ExpenseItem;
